package org.apache.commons.dbcp2.datasources;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotNull;
import static org.junit.jupiter.api.Assertions.assertNull;

import java.util.Arrays;

import org.junit.jupiter.api.Test;

class CharArrayTest1 {

    @Test
    void testClear() {
        // Step 0 & 1: Configure a character sequence holder with no content and clear it.
        final CharArray holderWithNoContent = new CharArray((char[]) null);
        final CharArray clearedHolderWithNoContent = holderWithNoContent.clear();
        // Step 2: Verify the holder returns no content.
        assertNull(clearedHolderWithNoContent.get());

        // Step 3 & 4: Prepare a character sequence holder with an empty sequence and clear it.
        final CharArray holderWithEmptySequence = new CharArray(new char[0]);
        final CharArray clearedHolderWithEmptySequence = holderWithEmptySequence.clear();
        // Step 5: Verify the holder maintains the empty state.
        assertEquals(0, clearedHolderWithEmptySequence.get().length);

        // Step 6: Set up a character sequence holder containing sensitive data.
        final char[] sensitiveData = "sensitive_data".toCharArray();
        final int originalLength = sensitiveData.length;
        final CharArray holderWithSensitiveData = new CharArray(sensitiveData);

        // Step 7: Instruct the system to perform the clearing operation.
        final CharArray sanitizedHolder = holderWithSensitiveData.clear();

        // Step 8: Verify the holder's content is replaced with neutral placeholders.
        final String sanitizedContent = sanitizedHolder.asString();
        assertNotNull(sanitizedContent);
        assertEquals(originalLength, sanitizedContent.length());
        final char[] expectedChars = new char[originalLength];
        Arrays.fill(expectedChars, (char) 0);
        assertEquals(new String(expectedChars), sanitizedContent);

        // Step 9: Verify the sanitized content preserves the original length.
        assertEquals(originalLength, sanitizedHolder.get().length);
    }
}

