        assertTrue(read_only_state_reenabled);

        connection_pooling_system.setDefaultReadOnly(null);
        Boolean read_only_state_cleared = connection_pooling_system.getDefaultReadOnly();
        assertNull(read_only_state_cleared);

        connection_pooling_system.close();
    }
}

